import React from 'react';
import {
  Box, Typography, TextField, Grid, Paper, Avatar
} from '@mui/material';

const ApplicationFormBPT = () => {
  return (
    <Box sx={{ pt: 4, px: 6, pb: 7 }}>
      <Typography variant="h5" gutterBottom align="center">
        APPLICATION FORM - Bachelor of Physiotherapy - 2025
      </Typography>

      <Grid container spacing={3}>
        {/* Advertisement Details */}
        <Grid item xs={12}>
          <Paper elevation={2} sx={{ p: 2 }}>
            <Typography variant="subtitle1" fontWeight="bold">Advertisement Details</Typography>
            <Grid container spacing={2}>
              <Grid item xs={6}><TextField label="Ad. No." value="AC2/241/2025/BPT" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="Ad. Date" value="09-Jun-2025" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="Application No." value="10003202500015" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="Course Name" value="Bachelor of Physiotherapy" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="Course Code" value="10003" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="Date of Entry" value="09-06-2025 01:23:55 PM" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="Last Date of Application" value="28-Jun-2025" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="Department" value="Academic Section II" fullWidth /></Grid>
            </Grid>
          </Paper>
        </Grid>

        {/* Applicant's Details */}
        <Grid item xs={12}>
          <Paper elevation={2} sx={{ p: 2 }}>
            <Typography variant="subtitle1" fontWeight="bold">Applicant's Details</Typography>
            <Grid container spacing={2}>
              <Grid item xs={6}><TextField label="Name" value="Ms. VAISHNAVI MOKTHALA" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="Father's Name" value="ANJAIAH MOKTHALA" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="Date of Birth" value="29-Dec-2005" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="Age (on last date)" value="20 Years / 0 Months / 2 Days" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="Place of Birth" value="AMANGAL" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="Social Status" value="BC-D" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="Nationality" value="Indian" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="Marital Status" value="Unmarried" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="Gender" value="Female" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="Differently Abled" value="No" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="Identification Mark 1" value="A MOLE ON THE LEFT CHEEK" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="Identification Mark 2" value="A MOLE ON THE LEFT HAND" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="University Area" value="Local" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="In-service (Govt.)" value="No" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="Aadhar" value="225135167216" fullWidth /></Grid>
              <Grid item xs={6}><TextField label="Father's Email" value="vaishnavimokthala65@gmai" fullWidth /></Grid>
            </Grid>
          </Paper>
        </Grid>

        {/* Parent/Spouse Details */}
        <Grid item xs={12}>
          <Paper elevation={2} sx={{ p: 2 }}>
            <Typography variant="subtitle1" fontWeight="bold">Parents' Details</Typography>
            <Grid container spacing={2}>
              <Grid item xs={4}><TextField label="Father's Name" value="ANJAIAH MOKTHALA" fullWidth /></Grid>
              <Grid item xs={4}><TextField label="Age" value="45" fullWidth /></Grid>
              <Grid item xs={4}><TextField label="Occupation" value="BUSINESS" fullWidth /></Grid>
              <Grid item xs={4}><TextField label="Mother's Name" value="ARUNA MOKTHALA" fullWidth /></Grid>
              <Grid item xs={4}><TextField label="Age" value="40" fullWidth /></Grid>
              <Grid item xs={4}><TextField label="Occupation" value="HOUSE WIFE" fullWidth /></Grid>
            </Grid>
          </Paper>
        </Grid>
      </Grid>
    </Box>
  );
};

export default ApplicationFormBPT;
